import React from 'react';
import skillList from '../../../utils/main/section-skills/skillList';

function SingleSkill() {
  const mySkills = skillList.map((item) => (
    <div key={item.index} className="my-skills-container">
      <li className="my-skills-item">
        <h3 className="single-skill-title">{item.title}</h3>
        <ul className="single-skill-list">
          <li className="single-skill-list">{item.skill.one}</li>
          <li className="single-skill-list">{item.skill.two}</li>
          <li className="single-skill-list">{item.skill.three}</li>
          <li className="single-skill-list">{item.skill.four}</li>
          <li className="single-skill-list">{item.skill.five}</li>
        </ul>
      </li>
    </div>
  ));

  return (
    <ul className="my-skills-list">
      {mySkills}
    </ul>
  );
}

export default SingleSkill;
